import settings from 'react-useanimations/lib/settings';

import avatar from "../resources/images/test_avatar.jpg"

import '../style/home.css'

const Home = () => { 
    return (
        <div className="container">
        <nav className="navbar">
            <button>
                <img src={registrationImage} alt="avatar" />
            </button>
            <button>All Chats</button>
            <button>Friends</button>
            
            <button><UseAnimations animation={settings} size={65} strokeColor="#B1B9C8" className="settings_animation" speed={1.25}/>Settings</button>
            <button>Saved</button>
            <button>Log out</button>
        </nav>
        <div className="main_window">
        </div>
        </div>
    );
}

export default Home;
